import React from "react";
import { Paper, Grid, Box } from "@material-ui/core";
import billboardPic from "../images/k.jpg";
import { matchPc, matchTablet } from "../DetectDevice";
import "./profile.css";
function Profile() {
  var widthh = matchPc ? "65.5vw" : "98vw";
  var topp = matchPc ? "2.8em" : matchTablet ? "3.5em" : "1.65em";
  var username = matchPc
    ? "usernamePc"
    : matchTablet
    ? "usernameTablet"
    : "usernameMobile";

  var widthName = matchPc ? "65.5vw" : "98vw";
  var topName = matchPc ? "8.8em" : matchTablet ? "11.3em" : "4em";
  var name = matchPc ? "namePc" : matchTablet ? "nameTablet" : "nameMobile";

  var widthConnect = matchPc ? "65.5vw" : "98vw";
  var bottomConnect = matchPc ? "9.5em" : matchTablet ? "11.3em" : "4.3em";
  var favclass = matchPc ? "favPc" : matchTablet ? "favTablet" : "favMobile";
  var fanclass = matchPc ? "fanPc" : matchTablet ? "fanTablet" : "fanMobile";

  var fontConnectText = matchPc ? "1.06vw" : matchTablet ? "2.5vw" : "1.7vh";
  var fontConnectnum = matchPc ? "1.65vw" : matchTablet ? "3.3vw" : "2.8vh";

  return (
    <Paper>
      <Grid container style={{ height: "100vh" }}>
        {/*///////////////////////////////////////////////////////////////////////////BACKPAD BILLBOARD LIGHTINING/DARKEN*/}
        <Grid
          container
          style={{
            position: "fixed",
            top: "0em",
            width: "100%",
            zIndex: 2,
          }}
        >
          <Grid
            item
            component={Box}
            display={{ xs: "none", md: "block" }}
            md={2}
          ></Grid>
          <Grid
            item
            xs={12}
            md={8}
            style={{
              height: "477px",
              backgroundColor: "rgba(250, 250, 250, 0.7)",
            }}
          ></Grid>
        </Grid>
        {/*///////////////////////////////////////////////////////////////////////////BACKPAD BILLBOARD LIGHTINING/DARKEN*/}

        <Grid
          item
          component={Box}
          display={{ xs: "none", md: "block" }}
          md={2}
        ></Grid>
        <Grid item xs={12} md={8}>
          {/*///////////////////////////////////////////////////////////////////////////IMAGE*/}
          <img
            className="turlightbillboard"
            style={{
              position: "relative",
              zIndex: 0,
              objectFit: "contain",
              width: "100%",
              borderRadius: "0px",
              borderBottomLeftRadius: matchPc ? "7px" : "0em",
              borderBottomRightRadius: matchPc ? "7px" : "0em",
              margin: "auto",
            }}
            src={billboardPic}
            alt="Superstarz Billboard Image"
          />{" "}
          {/*///////////////////////////////////////////////////////////////////////////IMAGE*/}
          {/*///////////////////////////////////////////////////////////////////////////USERNAME*/}
          <Grid
            item
            xs={12}
            style={{
              position: "absolute",
              width: widthh,
              height: "auto",
              top: topp,
              textAlign: "right",
              zIndex: 3,
            }}
          >
            <span className={`fontfamilyArial ${username} turlight`}>
              Hellsinki
            </span>
          </Grid>
          {/*///////////////////////////////////////////////////////////////////////////USERNAME*/}
          {/*///////////////////////////////////////////////////////////////////////////FULLNAME OR QUOTES*/}
          <Grid
            item
            xs={12}
            style={{
              position: "absolute",
              width: widthName,
              height: "auto",
              top: topName,
              textAlign: "right",
              zIndex: 3,
            }}
          >
            <span className={`fontfamilyArial ${name} turlight`}>
              i love the summers so much
            </span>
          </Grid>
          {/*///////////////////////////////////////////////////////////////////////////FULLNAME OR QUOTES*/}
          {/*///////////////////////////////////////////////////////////////////////////FAVS*/}
          <Grid
            item
            xs={12}
            style={{
              position: "relative",
              width: widthConnect,
              height: "auto",
              bottom: bottomConnect,
              display: "flex",
              justifyContent: "flex-end",
            }}
          >
            <Grid item style={{ textAlign: "center" }}>
              {" "}
              <span
                style={{
                  fontWeight: "bolder",
                  fontSize: fontConnectText,
                  backgroundColor: "rgba(255, 255, 255, 0.19)",
                  padding: "6px  ",
                  opacity: 0.8,
                }}
                className={`fontfamilyArial zuperxyinfo ${fanclass}  `}
              >
                FANS
              </span>
              <Grid xs={12} item style={{ height: "11px" }}></Grid>
              <span
                style={{
                  fontWeight: "bolder",
                  fontSize: fontConnectnum,
                  fontFamily: "kaushan_scriptregular",
                  marginRight: "0.5vw",
                  backgroundColor: "rgba(255, 255, 255, 0.03)",
                }}
                className={`fontfamilyArial zuperxyinfo ${fanclass}  `}
              >
                147
              </span>{" "}
            </Grid>
            <Grid item style={{ textAlign: "center" }}>
              {" "}
              <span
                style={{
                  fontWeight: "bolder",
                  fontSize: fontConnectText,
                  backgroundColor: "rgba(255, 255, 255, 0.19)",
                  padding: "6px  ",
                  opacity: 0.8,
                }}
                className={`fontfamilyArial zuperxyinfo ${favclass}`}
              >
                FAVORITES
              </span>
              <Grid xs={12} item style={{ height: "11px" }}></Grid>
              <span
                style={{
                  backgroundColor: "rgba(255, 255, 255, 0.03)",
                  fontWeight: "bolder",
                  fontSize: fontConnectnum,
                  fontFamily: "kaushan_scriptregular",
                  marginRight: "0.5vw",
                  marginTop: "9.2px",
                }}
                className={`fontfamilyArial zuperxyinfo ${favclass}`}
              >
                20
              </span>
            </Grid>
          </Grid>
          {/*///////////////////////////////////////////////////////////////////////////FAVS*/}
        </Grid>
      </Grid>
    </Paper>
  );
}

export default Profile;
